import React from 'react'

export default function ProjectCard ({data}) {
    const {title, description, imageURL, liveLink, gitLink} = data;
    return (
        <Project>
            <figure>
                <Img src={imageURL} />
                <DemoLink url={liveLink} />
                <GitLink url={gitLink} />
            </figure>
            <Title>{title}</Title>

            <Technologies></Technologies>

            <Description>{description}</Description>
        </Project>
    )
}
